import React, { useEffect, useState } from "react";

import { Box, Button, Center, FormControl, FormLabel, Heading, Input, Text, VStack } from '@chakra-ui/react'
import { useDispatch, useSelector } from "react-redux";
import { setAuthToken } from "../../../store/userSlice/user.slice";
import { useGetOrdersQuery } from "../../../api/store.api";
import { useCookies } from "react-cookie";
import { useLoginMutation } from "../../../api/user.api";
import { useNavigate } from "react-router-dom";


export const Login = ()=> {

    const dispatch = useDispatch()
    const navigate = useNavigate()

    const isAuthenticated = useSelector(state=> state.user.isAuthenticated)

    const [cookies, setCookie, removeCookie] = useCookies('authToken')

    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')

    const [login, {
            data: authToken,
            isLoading,
            isSuccess,
            error,
            isError,
        }] = useLoginMutation()

    useEffect(()=> {
        if(authToken!==undefined & isSuccess){

            let expireDate = new Date()
            const month = expireDate.getMonth()
            expireDate.setMonth(month==11? 0 : month+1)

            dispatch(setAuthToken(authToken.key))
            // removeCookie('authToken')
            // setCookie('authToken', authToken.key, {
            //     path: '/',
            //     expires: expireDate
            // })
            // navigate('/')

        }
    }, [isSuccess, authToken, ])


    const handleChangeEmail = (event)=> {
        event.preventDefault()
        setEmail(event.target.value)
    }
    const handleChangePassword = (event)=> {
        event.preventDefault()
        setPassword(event.target.value)
    }

    const onSubmit = (event)=> {
        event.preventDefault()
        login({email: email, password: password})
    }



    if(isAuthenticated){
        console.log(isAuthenticated)
        return (
            <Box>
                <Text align='center' fontSize='4xl' fontWeight='bold'>Attention vous ête déjà connecter</Text>
            </Box>
        )
    }

    return (

        <Box bgColor='gray.200' height='full'>
            <Center>
                <Box shadow='xs' width={['250px', 'xs', 'md']} bgColor='white' padding={8} paddingY={2} rounded={'lg'}>
                    <Text align='center' padding={2} fontSize={{base: 'xl'}} fontWeight='semibold'>Connection</Text>
                    <VStack>
                        <FormControl isRequired>
                            <FormLabel>Email: </FormLabel>
                            <Input size={['sm', 'md', 'lg',]} type='email' onChange={handleChangeEmail} value={email} />
                        </FormControl>
                        <FormControl isRequired>
                            <FormLabel>Password: </FormLabel>
                            <Input size={['sm', 'md', 'lg',]} type='password' onChange={handleChangePassword} value={password} />
                        </FormControl>
                        <Button  variant='solid' colorScheme={'twitter'} onClick={onSubmit}>Login</Button>
                    </VStack>
                </Box>
            </Center>
        </Box>
    )
}
